import React, {useState}  from 'react';
import './index.css';

function App(){

  const Gtime = new Date();
  Gtime = Gtime.getHours;

  return(
    <>
      <h1>{Gtime}</h1>
      <button >Click Me</button>
    </>
  )
}

export default App;
